// src/services/WalletService.ts
import { ethers } from 'ethers';
import EventEmitter from 'events';
import { ContractAPI } from './ContractAPI';

export class WalletService extends EventEmitter {
  public provider!: ethers.providers.Web3Provider;
  public signer!: ethers.Signer;
  private contractApi: ContractAPI;

  constructor(contractApi: ContractAPI) {
    super();
    this.contractApi = contractApi;
    this.init();
  }

  private async init() {
    // modern browsers inject window.ethereum
    if ((window as any).ethereum) {
      this.provider = new ethers.providers.Web3Provider((window as any).ethereum);
      try {
        // prompt user to connect
        await this.provider.send('eth_requestAccounts', []);
        this.signer = this.provider.getSigner();
        const account = await this.signer.getAddress();
        this.contractApi.setSigner(this.signer);
        this.emit('connected', account);
        await this.checkDeposit(account);
      } catch (err) {
        console.error('User denied account access', err);
      }
    } else {
      console.error('No Web3 provider found');
    }
  }

  private async checkDeposit(account: string) {
    const has = await this.contractApi.hasDeposited(account);
    if (has) {
      this.emit('deposited');
      this.emit('ready');
    }
  }

  public async deposit(amount: number) {
    const account = await this.signer.getAddress();
    await this.contractApi.deposit(amount);
    this.emit('deposited');
  }
}
